import React from "react";
import {useState, useEffect} from "react";
import logo from './logo.svg';
import './App.css';

function App() {
    const [books, setBooks] = useState([])

    useEffect(() => {
        setBooks([{
            "name": "Book1",
            "author": "author1",
            "description": "desc1"
        },
            {
                "name": "Book1",
                "author": "author1",
                "description": "desc1"
            }
        ])
    }, [])

    books.map((book, index) => {
        return (
            <div className="book-item">
                <h2>{book.name}</h2>
                <p>{book.author}</p>
                <p>{book.description}</p>
            </div>
        )}
    )


    return (
      <div className="App">
        <header className="App-header">
            <h1>DjangoReact</h1>
        </header>
          <div className="book-list">
              {books}
          </div>
      </div>
    );
}

export default App;
